import './message.css'

type TMessageData = {
  body: string,
  id: number,
  title: string
}

export function Message(data: TMessageData) {
  return (
    <div>
      <span>{data.title}</span>
      <p>{data.body}</p>
      <span>{data.id}</span>
    </div>
  )
}
